libs.content:
find_library(${_var}
    names ${_names}
    paths "${cuda_toolkit_root}"
    env cuda_path
    env cuda_lib_path
    path_suffixes ${_cuda_64bit_lib_dir} "${_path_ext}lib/win32" "${_path_ext}lib" "${_path_ext}libwin32"
    doc ${_doc}
    no_default_path
    )

find_library(lcms2_library
  names ${lcms2_names} lcms2 liblcms2 lcms-2 liblcms-2
  hints ${pc_lcms2_libdir} ${pc_lcms2_library_dirs}
)

find_library(svt_hevc_library
if(unix)
    names svthevcenc
else()
    names svthevcenc
endif()
    hints $env{svt_hevc_library_dir}
    paths env
    doc "svt-hevc library")

find_program(nasm_executable 
 names nasm nasm-2.13.0-win32 nasm-2.13.0-win64 nasm nasm-2.13.0-win32 nasm-2.13.0-win64
 hints $env{nasm_root} ${nasm_root}
 path_suffixes bin
)
